description:
The frontier molded him in its image. As a boy, he helped carve a homestead out of the primeval forest. He learned to live with hunger and cold while his broad-axe pushed the frontier westward. The wilderness taught him courage and self-reliance. At nineteen, he sailed down the mighty Mississippi in a flatboat built with his own hands.

Pioneer, boatman, rail-splitter, storekeeper and lawyer - he came to manhood a rough-hewn giant with the love of his land and his people fused into his very bone and sinew.

America shaped Abraham Lincoln and it fell to Lincoln to reshape America - for ahead of him lay an appointment with destiny.




